// Bordered & Pulled
// -------------------------

.#{$fa-css-prefix}-border {
  border: solid .08em $fa-border-color;
  border-radius: .1em;
  padding: .2em .25em .15em;
}

.#{$fa-css-prefix}-pull-left { float: left; }
.#{$fa-css-prefix}-pull-right { float: right; }

.#{$fa-css-prefix},
.fas,
.far,
.fal,
.fab {
  &.#{$fa-css-prefix}-pull-left { margin-right: .3em; }
  &.#{$fa-css-prefix}-pull-right { margin-left: .3em; }
}

// Animated Icons
// --------------------------

.#{$fa-css-prefix}-spin {
  animation: fa-spin 2s infinite linear;
}

.#{$fa-css-prefix}-pulse {
  animation: fa-spin 1s infinite steps(8);
}

@keyframes fa-spin {
  0% {
    transform: rotate(0deg);
  }

  100% {
    transform: rotate(360deg);
  }
}

// Rotated & Flipped Icons
// -------------------------

.#{$fa-css-prefix}-rotate-90  { @include fa-icon-rotate(90deg, 1);  }
.#{$fa-css-prefix}-rotate-180 { @include fa-icon-rotate(180deg, 2); }
.#{$fa-css-prefix}-rotate-270 { @include fa-icon-rotate(270deg, 3); }

.#{$fa-css-prefix}-flip-horizontal { @include fa-icon-flip(-1, 1, 0); }
.#{$fa-css-prefix}-flip-vertical   { @include fa-icon-flip(1, -1, 2); }
.#{$fa-css-prefix}-flip-both, .#{$fa-css-prefix}-flip-horizontal.#{$fa-css-prefix}-flip-vertical { @include fa-icon-flip(-1, -1, 2); }

// Hook for IE8-9
// -------------------------

:root {
  .#{$fa-css-prefix}-rotate-90,
  .#{$fa-css-prefix}-rotate-180,
  .#{$fa-css-prefix}-rotate-270,
  .#{$fa-css-prefix}-flip-horizontal,
  .#{$fa-css-prefix}-flip-vertical,
  .#{$fa-css-prefix}-flip-both {
    filter: none;
  }
}

// Mixins
// --------------------------

@mixin fa-icon {
  -webkit-font-smoothing: antialiased;
  -moz-osx-font-smoothing: grayscale;
  display: inline-block;
  font-style: normal;
  font-variant: normal;
  font-weight: normal;
  line-height: 1;
}

@mixin fa-icon-rotate($degrees, $rotation) {
  -ms-filter: "progid:DXImageTransform.Microsoft.BasicImage(rotation=#{$rotation})";
  transform: rotate($degrees);
}

@mixin fa-icon-flip($horiz, $vert, $rotation) {
  -ms-filter: "progid:DXImageTransform.Microsoft.BasicImage(rotation=#{$rotation}, mirror=1)";
  transform: scale($horiz, $vert);
}


// Only display content to screen readers. A la Bootstrap 4.
//
// See: http://a11yproject.com/posts/how-to-hide-content/

@mixin sr-only {
  border: 0;
  clip: rect(0, 0, 0, 0);
  height: 1px;
  margin: -1px;
  overflow: hidden;
  padding: 0;
  position: absolute;
  width: 1px;
}

// Use in conjunction with .sr-only to only display content when it's focused.
//
// Useful for "Skip to main content" links; see http://www.w3.org/TR/2013/NOTE-WCAG20-TECHS-20130905/G1
//
// Credit: HTML5 Boilerplate

@mixin sr-only-focusable {
  &:active,
  &:focus {
    clip: auto;
    height: auto;
    margin: 0;
    overflow: visible;
    position: static;
    width: auto;
  }
}

// Stacked Icons
// -------------------------

.#{$fa-css-prefix}-stack {
  display: inline-block;
  height: 2em;
  line-height: 2em;
  position: relative;
  vertical-align: middle;
  width: ($fa-fw-width*2);
}

.#{$fa-css-prefix}-stack-1x,
.#{$fa-css-prefix}-stack-2x {
  left: 0;
  position: absolute;
  text-align: center;
  width: 100%;
}

.#{$fa-css-prefix}-stack-1x {
  line-height: inherit;
}

.#{$fa-css-prefix}-stack-2x {
  font-size: 2em;
}

.#{$fa-css-prefix}-inverse {
  color: $fa-inverse;
}

sources.style/_general.scss:
body {
	font-family: "Helvetica Neue", Helvetica, Arial, sans-serif;

	* {
		box-sizing: border-box;
		letter-spacing: 1.5px;
	}
}

.entrance {
	display: grid;
	margin-bottom: 24px;
	grid-template-columns: 355px auto;
	@media screen and(max-width:1023px) {
		display: block;
	}
	@media print {
		display: block;
	}
	.first-sight {
		padding: $gutter*2;
		padding-bottom: 2px;
		.on-printed {
			display: none;
			@media print {
				display: initial;
			}
		}
		h2 {
			color: var(--secondary-color);
		}
		@media print {
			margin-top: -40px;
		}
	}
}

p {
	font-size: 16px;
}

h3 {
	font-size: 3em;
}

svg[class*="fa"] {
	margin-right: 8px;
	width: 24px !important;
	height: 24px !important;
}

sources.style/_basic-info.scss:
.basic-info {
  padding: $gutter*2;
  width: 100%;
  height: auto;
  text-align: center;
  background-color: var(--primary-color);
  min-height: 300px;
  max-height: 720px;
  color: var(--text-color);
  position: relative; // fallback
  position: sticky;
  top: 0;
  left: 0;
  @media screen and(max-width:1023px) {
    position: initial;
  }
  @media print {
    position: initial;
  }
  &__head {
    h1 {
      font-size: 60px;
      margin-bottom: $gutter*2;
    }
    figure {
      margin: 0;
      margin-bottom: $gutter*2;
      img {
        display: block;
        border-radius: 100%;
        border-bottom: $gutter*2;
        position: relative;
        margin: 0 auto;
        max-width: 100%;
        width: 200px;
        height: 200px;
      }
    }
  }
  &__body {
    h2 {
      font-size: 24px;
      border-bottom: solid 1px var(--text-color);
      margin-bottom: $gutter*2;
      padding-bottom: $gutter*2;
    }
    ul {
      list-style: none;
      text-align: left;
      li {
        display: flex;
        a {
          text-decoration: none;
          color: #000000;
          margin-left: $gutter;
          &:hover {
            text-decoration: underline;
          }
        }
        svg {
          width: 20px !important;
          height: 20px !important;
        }
      }
      .no-print {
        @media print {
          display: none;
        }
      }
    }
  }
}

